INSERT INTO `candidates` (`id`, `image`, `name`, `sex`, `rayon_id`, `visi`, `misi`, `latar_belakang`, `created_at`, `updated_at`, `nis`) VALUES
(1, 'candidates_607060f846674David.jpg', 'David Satya Wibisono', 'Laki-laki', 16, 'Membantu mewujudkan generasi muda yang mandiri, kreatif, inovatif, dan produktif demi kemajuan SMK Wikrama Kota Bogor.', '- Mengembangkan rasa sosial, tanggung jawab, dan saling menghargai antar warga sekolah.\r\n- Melanjutkan dan mengembangkan program kegiatan yang sudah dibuat oleh OSIS angkatan sebelumnya.', 'Ketua 2 OSIS SMK Wikrama Bogor 2019/2020', '2021-04-09 07:13:12', '2021-04-09 07:13:12', '11907084'),
(2, 'candidates_6070627f1c369Alfi.jpg', 'Alfi Ilham', 'Laki-laki', 32, 'Menjadikan siswa-siswi SMK Wikrama yang sesuai dengan karakter Wikrama, melengkapi kekurangan OSIS yang ada tanpa menguranginya dan tetap berlandaskan kepada Tuhan Yang Maha Esa', 'Meningkatkan kinerja OSIS, sering mengadakan seminar untuk merubah pola pikir siswa kepada Tuhan Yang Maha Esa, menjadikan, mengembangkan bakat, minat, dan potensi siswa melalui kegiatan ekstrakurikuler yang ada, menjadikan OSIS sebagai organisasi yang menyenangkan', 'Sekretaris OSIS (kelas 7), Ketua OSIS (kelas 8), Pengurus OSIS SMK Wikrama Bogor 2019/2020 (Sekbid 2)', '2021-04-09 07:15:57', '2021-04-09 07:19:43', '11907007'),
(3, 'candidates_6070623c53181Riki.jpg', 'Riki Suryo Nugroho', 'Laki-laki', 25, '1. Menghilangkan rasa senioritas antar warga SMK Wikrama Bogor\r\n2. Membangun suatu mitra atau kerja sama dengan sekolah lain\r\n3. Menjadikan OSIS sebagai wadah aspirasi bagi para siswa/i', '1. Menanamkan dalam diri siswa rasa saling hormat menghormati antar warga SMK Wikrama\r\n2.Mengajak sekolah lain untuk berkolaborasi di bidang non akademik seperti ekstrakulikuler ataupun kesenian\r\n3. Menjalin kerja sama dengan organisasi sekolah lain untuk memacu kreatifitas siswa\r\n4. Menyerap dan memperhatikan aspirasi para siswa dengan mengadakan sosialisasi', 'Palang Merah Remaja, Pengurus OSIS SMK Wikrama Bogor 2019/2020 (Sekbid 7)', '2021-04-09 07:18:36', '2021-04-09 07:20:27', '11907482');
